<?php
	$data = json_decode('[{ "woff" : ["data:application/x-font-woff;charset=utf-8;base64,","data:application/x-font-woff;charset=utf-8;base64,","data:application/x-font-woff;charset=utf-8;base64,"]},{ "otf" : ["data:application/opentype;charset=utf-8;base64,","data:application/opentype;charset=utf-8;base64,","data:application/opentype;charset=utf-8;base64,"]}]');
	foreach($data as $formats){
		foreach($formats as $format => $files){
			foreach($files as $file){
				$filename = time().rand(pow(10, 10-1), pow(10, 10)-1).'.'.$format;
				file_put_contents('fonts/'.$filename, $file );
				echo $filename;
			}
		}
	}
?>